  const classes = useStyles()
  const {darkMode, setDarkMode} = GlobalContext()


  return (
    <AppBar position="sticky" className={classes.root} color="inherit">
      <Toolbar variant="dense" style={{display: 'flex'}}>
        <div style={{flexGrow: '1'}}> 
          <Tabs
            value={0}
          >
            <Tab label="home" />
            <Link href="#about" color="inherit"><Tab label="about" /></Link>
            <Tab label="projects" />
            <Tab label="blog" />
            <Link href="#contact" color="inherit"><Tab label="contacts" /></Link>

          </Tabs>
        </div>
        <div>
          <IconButton onClick={()=>setDarkMode(!darkMode)}>
            {darkMode ? <WbSunnyIcon/> : <Brightness3Icon />}
          </IconButton>
        </div>
      </Toolbar>
    </AppBar>

